define({"topics" : [{"title":"Declaring test objectives","shortdesc":"\n                     <p class=\"shortdesc\">The first step in creating test objectives is to declare them in the             <code class=\"ph codeph\">Objectives</code> section of the test module.\n                     </p>\n                  ","id":"task_k35_4n3_hm","href":"TA_Help\/Topics\/Projects_and_tests_TO_declaring.html","menu": {"hasChildren":false,},"tocID":"task_k35_4n3_hm-d46e22203","topics":[]},{"title":"Inserting test objectives into a test case","shortdesc":"\n                     <p class=\"shortdesc\">After declaring test objectives in the <code class=\"ph codeph\">Objectives</code> section, you can         insert test objectives into a test case.\n                     </p>\n                  ","id":"task_wtq_lq3_hm","href":"TA_Help\/Topics\/Projects_and_tests_TO_inserting.html","menu": {"hasChildren":false,},"tocID":"task_wtq_lq3_hm-d46e22217","topics":[]},{"title":"Modifying test objectives","shortdesc":"\n                     <p class=\"shortdesc\">Various fields of a test objective can be edited by you.</p>\n                  ","id":"task_uly_2t3_hm","href":"TA_Help\/Topics\/Projects_and_tests_TO_modifying.html","menu": {"hasChildren":false,},"tocID":"task_uly_2t3_hm-d46e22233","topics":[]},{"title":"Deleting test objectives","shortdesc":"\n                     <p class=\"shortdesc\">Test objectives can be deleted from a test module when no longer needed.</p>\n                  ","id":"task_xyq_k53_hm","href":"TA_Help\/Topics\/Projects_and_tests_TO_deleting.html","menu": {"hasChildren":false,},"tocID":"task_xyq_k53_hm-d46e22244","topics":[]}]});